import { Button, TextField, Typography } from '@mui/material';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import './App.css';
import Nav from './components/Nav';
import Login from './views/Login';

function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Switch>
          <Route path='/Login'>
            <Login />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
